import { STUDENT_LOGOUT } from "../actionTypes";

const initialState = {
  authData: null,
};

const studentReducer = (state = initialState, action) => {
  switch (action.type) {
    case STUDENT_LOGOUT:
      localStorage.removeItem("teacherUser");
      return { ...state, authData: null };

    default:
      return state;
  }
};

export default studentReducer;
